import './Login.css';
import log from './DK KD Logo.jpg';

function App() {
  return (
    <div className="App">
          <div className="loginform">
    
    <h2 className='title'>LOGIN FORM</h2>
      <div className="form">
      
        <form>
            
            <label className='name' type='text'  >Username :</label><br></br>
            <input className='iname' placeholder='NAME'></input>
            <label className='email ' type="email">Email :</label><br></br>
            <input className='ieml' placeholder='EMAIL'></input>
            <label className='pass' type="password">Password :</label><br></br>
            <input className='ipass' placeholder='PASSWORD'></input><br></br>
            <center><button className='subbt'>SUBMIT</button></center><br></br>
            <a href='#'>Forgot password</a>
            
        </form>
        <center><p>Or</p></center>
        <center><button className='signup'>Sign up</button></center>

      </div>
    </div>
    </div>
    

  );
}

export default App;
